<li><strong>掌握火候</strong>：炒至辣椒段颜色变为深棕色，散发出浓郁的香气时，立即用漏勺将花椒和辣椒段捞出。</li>
<li><strong>剁碎</strong>：将捞出的香料在砧板上用刀剁成粗颗粒状，即为“刀口海椒”。</li>
<li><strong>保留香料油</strong>：炸过花椒辣椒的油是宝贵的香料油，倒入碗中晾凉备用，最后淋油时使用。</li>
